import React, { useState } from 'react';
import './Service.css';

const Service = () => {
  const [activeCategory, setActiveCategory] = useState('aandrijving');

  const categories = [
    {
      id: 'aandrijving',
      name: 'Aandrijving',
      icon: 'fas fa-cog',
      services: [
        { title: 'Essential Wash', price: 'Vanaf €59,-', icon: 'fas fa-car' },
        { title: 'Premium Wash', price: 'Vanaf €109,-', icon: 'fas fa-star' },
        { title: 'Wash & Wax', price: 'Vanaf €149,-', icon: 'fas fa-spray-can' },
        { title: 'Booster Wash', price: 'Vanaf €159,-', icon: 'fas fa-bolt' }
      ]
    },
    {
      id: 'onderstel',
      name: 'Onderstel',
      icon: 'fas fa-car-side',
      services: [
        { title: 'Cabrio Dak', price: 'Vanaf €39,-', icon: 'fas fa-car-side' },
        { title: 'Bodem Reiniging', price: 'Prijs op aanvraag', icon: 'fas fa-car-battery' },
        { title: 'Motor compartiment', price: 'Vanaf €39,-', icon: 'fas fa-cog' },
        { title: 'Velgen & Wielkasten', price: 'Vanaf €169,-', icon: 'fas fa-circle' }
      ]
    },
    {
      id: 'carrosserie',
      name: 'Carrosserie',
      icon: 'fas fa-car',
      services: [
        { title: 'Carrosserie reparatie', price: 'Prijs op aanvraag', icon: 'fas fa-wrench' },
        { title: 'Spuitwerk', price: 'Prijs op aanvraag', icon: 'fas fa-paint-brush' },
        { title: 'Dent repair', price: 'Prijs op aanvraag', icon: 'fas fa-hammer' },
        { title: 'Smart repair', price: 'Prijs op aanvraag', icon: 'fas fa-magic' }
      ]
    },
    {
      id: 'elektronica',
      name: 'Elektronica',
      icon: 'fas fa-microchip',
      services: [
        { title: 'Diagnose', price: 'Vanaf €49,-', icon: 'fas fa-search' },
        { title: 'Software updates', price: 'Prijs op aanvraag', icon: 'fas fa-download' },
        { title: 'Elektrische reparaties', price: 'Prijs op aanvraag', icon: 'fas fa-bolt' },
        { title: 'Sensoren vervangen', price: 'Prijs op aanvraag', icon: 'fas fa-eye' }
      ]
    }
  ];

  const handleCategoryClick = (categoryId) => {
    setActiveCategory(categoryId);
  };

  return (
    <section className="service-page">
      <div className="container">
        <div className="page-header">
          <h1>BETROUWBARE ZORG VOOR OPTIMALE PRESTATIES</h1>
          <h2>Onderhoud & Reparatie voor Uw Voertuig</h2>
          <div className="intro-text">
            <p>
              Bij Premium Car Works krijgt uw auto de aandacht en zorg die het verdient. Onze Service-afdeling biedt een compleet pakket aan onderhouds- en reparatiediensten, vergelijkbaar met een traditionele autogarage.
            </p>
            <p>
              Dankzij onze ervaring werken wij met hoogwaardige onderdelen en geavanceerde technieken om uw voertuig veilig, betrouwbaar en in topconditie te houden.
            </p>
          </div>
        </div>

        <div className="service-categories">
          <h3>Onze service categorieën</h3>
          <div className="category-buttons">
            {categories.map((category) => (
              <button 
                key={category.id}
                className={`category-btn ${activeCategory === category.id ? 'active' : ''}`}
                onClick={() => handleCategoryClick(category.id)}
              >
                <div className="category-icon">
                  <i className={category.icon}></i>
                </div>
                <span>{category.name}</span>
              </button>
            ))}
          </div>
        </div>

        <div className="services-section">
          <div className="services-grid">
            {categories
              .find(cat => cat.id === activeCategory)
              ?.services.map((service, index) => (
                <div key={index} className="service-card">
                  <div className="service-icon">
                    <i className={service.icon}></i>
                  </div>
                  <h3 className="service-title">{service.title}</h3>
                  <p className="service-price">{service.price}</p>
                </div>
              ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default Service;
